text:
Anotações do jogo:

Inter:
Maurício fazendo a lei do ex na partida;
Valencia perdendo gol ou oportunidade de finalizar;
Wanderson caminhando com a bola até fazer o segundo;
Coudet esperando levar gol do Cruzeiro pra mexer no time.

Cruzeiro:
Acertou 3 vezes o travessão;
Matheus Jussa batendo do meio da rua toda bola que recebia;
Cruzeiro pedindo um pênalti a cada 5 segundos ( e conseguiram );
torcida mostrando todo seu carinho ao treinador Zé Ricardo.

Narrador: Alan Paticri 0:03 😂

